int find(u16 unicode, signtable sign[], int I) {
	int low = 0;
	int high = I - 1;
	int middle = 0;
	while (low <=high) {
		middle = (low + high) >> 1;
		if (unicode == sign[middle].unicode) {
			//printf("%s", sign[middle].numdot);
			return middle;
		}
		else {
			if (unicode > sign[middle].unicode) {
				low = middle + 1;
			}
			else {
				high = middle - 1;
			}

		}
		
	}
	return 0;
}


